import React from 'react';
import { Container,Row,Col} from 'react-bootstrap';
import IcoMoon from "react-icomoon";
class FooterCopyright extends React.Component {
 render()
 {
    return (
    <div >
     
     <footer id="ultimocontenido">
         <Container>
 <Row>
  
    <Col md={12}>
     <div  class="text-center">
        <a id="redesicon" href="" class="icon icon-facebook1"></a>
        <a id="redesicon" href="" class="icon icon-linkedin"></a>
        <a id="redesicon" href="" class="icon icon-instagram"></a>
        <a id="redesicon" href="" class="icon icon-googleplus"></a>
        <a id="redesicon" href="" class="icon icon-twitter"></a>
        <IcoMoon id="RedSocial" icon="facebook2" />
              <IcoMoon id="RedSocial" icon="linkedin" />
                <IcoMoon id="RedSocial" icon="instagram" />
                <IcoMoon id="RedSocial" icon="google" />
                <IcoMoon id="RedSocial" icon="twitter" />

       <br> </br>
        <p>Copyright Â© 2019 FRT All Right Reserved</p>
     </div>
    

     </Col>

  </Row>
</Container>
 </footer>

    </div>
  );
}
}
export default FooterCopyright;
